import React from "react"
import NINE from "../nl_logo.png";
import { BrowserRouter, Link, browserHistory, Redirect } from "react-router-dom";
import { withRouter } from "react-router";
import { Icon } from 'semantic-ui-react'
import 'semantic-ui/dist/semantic.min.css';
import './Sidebar.css';
import apiconstants from '../employee/config';



class Sidebar extends React.Component {
    constructor(props) {
        super(props);
        // this.state = {
        // }
        // this.onItemClick=this.onItemClick.bind(this)

    }
    componentDidMount = () => {
     this.setState({id:this.props.mid});  

     let id = this.props.match.params.mid

     fetch(apiconstants.URL + `profile/${id}`, {
         method: 'GET',

         headers: {
             'content-Type': 'application/json',
             'Accept': 'application/json',
         },
     })
         .then(res => res.json())
         .then(res => {
             console.log('res', JSON.stringify(res));
             this.setState({ data1: res });
             console.log(res)
         })
    }

    render() {
        // console.log(this.props.history.push)
        // const { data1 } = this.state;
        return (
            <BrowserRouter>
                <nav>
                    <div class="sidenav" id="sidebar">
                         <div className="profiletab" style={{ float: "right" }}>
                            <img style={{ width: "50px" }}  />
                            &nbsp; &nbsp;
        {/* {data1.name}<br />
                            {data1.email} */}
                        </div>
                        <a href="#about">My Feedback</a>
                        <a href="#services">My Goals</a>

                    </div>
                </nav>
            </BrowserRouter>
        )
    }
}
export default withRouter(Sidebar)
